public boolean equals(Object other) {
  if (this == other) {
    return true;
  }
  if (other == null || !(other instanceof GetAllResourceProfilesResponse)) {
    return false;
  }
  return ((GetAllResourceProfilesResponse) other).getResourceProfiles()
      .equals(this.getResourceProfiles());
}
